import React from 'react';
import axios from 'axios';

const api = axios.create({baseURL:'http://localhost:8080/'})

function GetAllAccounts () {

    api.get('accounts/').then(res => {
            console.log(res.data);
        }
    )
    
return(

    <p> {res}</p>
)
}

export default GetAllAccounts;
